import image from './2023.png';
import './nav.css';
function Nav(){
    return (
        <>
        <div className="nav-box">
          <div className="logo">
            <img className="img" src={image}/>
          </div>
          <div className='search'>hlo</div>
        </div>
        </>
    );
}
export default Nav;
